import React from 'react' // 'Next는 따로 import해주지 않아도 되지만 구조상 사용함'
import Link from 'next/link';
import AppLayout from '../components/AppLayout';

const Home = () => {
    return (
        <AppLayout>
        <Link href="/about"><a>about</a></Link>

        <div>Hello Next.js!</div>
        </AppLayout>
    );
};

export default Home;
